233926;instagram;2018-11-09 06:26:25;FALSE;'भाई दूज', 'बेटी बचाओ', केवल इसलिये नहीं की वो घर की लक्ष्मी हैं, बल्कि इसलिये की वो हमारा मान हैं, वो एक सुखद एहसास हैं, इसलिये क्योंकि बेटियां 'माँ' है, और इसलिये भी की वो भविष्य हैं। और हां बेटियों को सिर्फ बचाना ही नहीं है , उनका सम्मान करने की परम्परा भी लड़कों में बचपन से डालनी चाहिये, जिससे समाज को एक सही दिशा मिल सके। #future #society #artofvisuals #photofeature #social  #savegirlchild #woman #womans #women #womenempowerment #womens #girls #girl #gal #kid #abortion #socialmessage #kids #girlchildeducation #hope #messages #birth #mother #mom #indiafeatures #socialmedia #love #child #honour #metoo;;en;#future, #society, #artofvisuals, #photofeature, #social, #savegirlchild, #woman, #womans, #women, #womenempowerment, #womens, #girls, #girl, #gal, #kid, #abortion, #socialmessage, #kids, #girlchildeducation, #hope, #messages, #birth, #mother, #mom, #indiafeatures, #socialmedia, #love, #child, #honour, #metoo;;;;;0;;pagmark14;Gaurav Saxena;;0;False;11;0;0;386;https://instagram.fyvr3-1.fna.fbcdn.net/vp/7dd0e5cc6b338adac5061bf8b3487889/5D104C70/t51.2885-15/e35/43913352_504425313370089_153259508456488960_n.jpg?_nc_ht=instagram.fyvr3-1.fna.fbcdn.net;0;FALSE;FALSE;FALSE;english;'भाई दूज', 'बेटी बचाओ', केवल इसलिये नहीं की वो घर की लक्ष्मी हैं, बल्कि इसलिये की वो हमारा मान हैं, वो एक सुखद एहसास हैं, इसलिये क्योंकि बेटियां 'माँ' है, और इसलिये भी की वो भविष्य हैं। और हां बेटियों को सिर्फ बचाना ही नहीं है , उनका सम्मान करने की परम्परा भी लड़कों में बचपन से डालनी चाहिये, जिससे समाज को एक सही दिशा मिल सके। #future #society #artofvisuals #photofeature #social  #savegirlchild #woman #womans #women #womenempowerment #womens #girls #girl #gal #kid #abortion #socialmessage #kids #girlchildeducation #hope #messages #birth #mother #mom #indiafeatures #socialmedia #love #child #honour #metoo;'भाई दूज', 'बेटी बचाओ', केवल इसलिये नहीं की वो घर की लक्ष्मी हैं, बल्कि इसलिये की वो हमारा मान हैं, वो एक सुखद एहसास हैं, इसलिये क्योंकि बेटियां 'माँ' है, और इसलिये भी की वो भविष्य हैं। और हां बेटियों को सिर्फ बचाना ही नहीं है , उनका सम्मान करने की परम्परा भी लड़कों में बचपन से डालनी चाहिये, जिससे समाज को एक सही दिशा मिल सके।                               ;'भाई दूज ' , 'बेटी बचाओ ' , केवल इसलिये नहीं की वो घर की लक्ष्मी हैं , बल्कि इसलिये की वो हमारा मान हैं , वो एक सुखद एहसास हैं , इसलिये क्योंकि बेटियां 'माँ ' है , और इसलिये भी की वो भविष्य हैं। और हां बेटियों को सिर्फ बचाना ही नहीं है , उनका सम्मान करने की परम्परा भी लड़कों में बचपन से डालनी चाहिये , जिससे समाज को एक सही दिशा मिल सके। ;[(""'भाई""
